	(104, 'common', 100, NULL, 0, 1, '[공지사항] 서울국제대안영상페스티벌 온라인 상영관 오픈 일정', '<p style="text-align: left;"><img src="/upload/image/common_board/editor/네마프 대지2_대지 1_20210812155822vgu.jpg" data-filename="1298" style="font-family: " noto="" sans="" kr",="" sans-serif;="" width:="" 50%;"=""><br></p><p style="text-align: left;"><br></p><p style="text-align: center; color: rgb(0, 0, 0);"><b>[서울국제대안영상페스티벌 온라인 상영관 오픈 일정]</b></p><p style="text-align: center; color: rgb(0, 0, 0);"><b><br></b></p><p style="text-align: center; color: rgb(0, 0, 0);">제21회 서울국제대안영상페스티벌의 온라인 상영관은 </p><p style="text-align: center; color: rgb(0, 0, 0);"><b>8월 19일 오전 11시부터 8월 27일 24시(자정)</b>까지 운영됩니다.</p><p style="text-align: center; color: rgb(0, 0, 0);">온라인 상영작은 총 31편이며 관람료는 영화별로 다릅니다.&nbsp; &nbsp;&nbsp;</p><p style="text-align: center; color: rgb(0, 0, 0);"><br></p><p style="text-align: center; color: rgb(0, 0, 0);">◆ <b>결제 가능 시간</b> : </p><p style="text-align: center; color: rgb(0, 0, 0);">8월 19일 11:00 ~ 8월 27일 23:59:59</p><p style="text-align: center; color: rgb(0, 0, 0);"><br></p><p style="text-align: center; color: rgb(0, 0, 0);"><span style="color: rgb(0, 0, 0);">◆</span><span style="color: rgb(0, 0, 0);">&nbsp;</span><b>관람 가능 시간</b>&nbsp;: </p><p style="text-align: center; color: rgb(0, 0, 0);">관람 가능 시간은 결제 후 24시간 이내입니다.</p><p style="text-align: center; color: rgb(0, 0, 0);">이는 관람의 시작이 아닌 종료 시점입니다.</p><p style="text-align: center;"><br></p><p style="text-align: center;">8월 27일 24:00(자정) 이후에는 모든 상영이 종료되므로 </p><p style="text-align: center;">러닝 타임을 고려하여 관람하시기 바랍니다.</p><p style="text-align: center; color: rgb(0, 0, 0);"><br></p><p style="text-align: center; color: rgb(0, 0, 0);">◆ <b>환불 규정 :</b></p><p style="text-align: center; color: rgb(0, 0, 0);">결제 후에는 관람 유무와 상관 없이 취소 및 환불이 되지 않습니다.</p><p style="text-align: center; color: rgb(0, 0, 0);"><br></p><p style="text-align: center; color: rgb(0, 0, 0);"><br></p><p style="text-align: center; "> </p>', 134, '2021-08-12 16:00:13', '2021-08-27 13:38:27'),
