	(111, 'common', 0, 936, 0, 1, '컴퓨터 관련 문의 드립니다', '<p>이번서 서울국제여성영화제 온라인 상영을 보려고 하는데 맥북에서 크롬을 이용해서 보려고 하는데 괜찮은가요?</p><p>메인 화면에 ios는 관람하기 힘들다는 안내를 봐서요.</p>', 3, '2021-08-17 17:14:02', '2021-10-11 16:56:57'),
	(112, 'common', 0, 930, 0, 1, '문의드립니다. ', '<p>이번에 여성영화제에서 상영하는 대안현실에 주문 걸기 라는 영화를 예매했는데</p><p>마지막에 결제오류창이 떠서 다시 예매했는데 마지막에 또 오류창이 떠서요.</p><p>결제가 안 된걸로 알고 있었는데 </p><p>메일을 확인해보니 두번 결제가 되어있어서 문의드립니다.</p><p>예매가 된 게 맞나요~?</p><p>맞다면 중복된 결제 하나는 취소 부탁드립니다.&nbsp;</p>', 2, '2021-08-18 17:27:37', '2021-09-14 13:38:42'),
