	(116, 'common', 0, 990, 0, 1, '애플사의 모든 기기에서 영상을 볼수없는건가요?', '\r\n            ', 5, '2021-08-19 21:33:20', '2021-10-11 15:56:57'),
	(117, 'notice', 0, 1074, 1, 0, '해외 관람 문의', '<p>안녕하세요,</p><p><br></p><p>오는 서울국제여성영화제를 온라인으로 관람하고 싶은데 해외 거주자도 결제하면 볼 수 있나요?</p><p>그리고 iOS(아이폰)에서만 관람이 불가하지, MacOS(맥북 등 애플체제 컴퓨터)에서는 관람이 가능하지요?</p><p><br></p><p>감사합니다.&nbsp;</p>', 22, '2021-08-20 04:16:09', '2021-09-14 10:15:24'),
	(118, 'notice', 100, 997, 0, 1, '[공지사항] 모바일 SNS 로그인 및 SNS 회원가입 관련', '<div style="text-align: center; "><b>[공지사항] </b></div><div style="text-align: center; "><b>모바일 SNS 로그인 및 SNS 회원가입 오류</b></div><div style="text-align: center;"><br></div><div style="text-align: center;">안녕하세요.&nbsp;</div><div style="text-align: center;">온피프엔입니다.</div><div style="text-align: center;"><br></div><div style="text-align: center;">금일 모바일 SNS 로그인 및 SNS 회원가입시 </div><div style="text-align: center;">오류가 발생하고 있습니다.</div><div style="text-align: center;">현재 빠르게 조치하고 있습니다.</div><div style="text-align: center;"><br></div><div style="text-align: center;"><b>&lt;온피프엔 간편 회원가입&gt; 및 </b></div><div style="text-align: center;"><b>아이디와 패스워드를 통한 로그인을 부탁드립니다.</b></div><div style="text-align: center;"><br></div><div style="text-align: center;">불편을 끼쳐 드려 정말 죄송합니다.</div><div style="text-align: center;"><br></div><div style="text-align: center;">조치 후 재공지 드리겠습니다.</div><div style="text-align: center;"><br></div><div style="text-align: center; ">감사합니다.</div> ', 35, '2021-08-20 10:35:48', '2021-09-15 10:47:53'),
	(119, 'notice', 100, 997, 0, 1, '[공지사항] <온피프엔> 안드로이드 모바일 앱(APP) 관련', '<div style="text-align: center; "><b>[공지사항] </b></div><div style="text-align: center; "><b>&lt;온피프엔&gt; 안드로이드 모바일 앱(APP) 일시적 오류&nbsp;</b></div><div style="text-align: center;"><br></div><div style="text-align: center;">안녕하세요</div><div style="text-align: center;">온피프엔입니다.</div><div style="text-align: center;"><br></div><div style="text-align: center;">현재 안드로이드 모바일 앱(APP)이 원활하게 작동하지 않고 있습니다.</div><div style="text-align: center;"><br></div><div style="text-align: center;">빠르게 조치 중에 있사오니,<br></div><div style="text-align: center;"><b>가급적 PC에서 관람을 부탁드리겠습니다</b>.</div><div style="text-align: center;"><br></div><div style="text-align: center;">불편을 끼쳐드려 대단히 죄송합니다.</div><div style="text-align: center; "><br></div><div style="text-align: center; ">감사합니다.</div> ', 38, '2021-08-20 17:53:42', '2021-09-15 10:47:44'),
