	(104, '0', 100, NULL, 0, 1, '[공지사항] 서울국제대안영상페스티벌 온라인 상영관 오픈 일정', '<p style="text-align: left;"><img src="/upload/image/common_board/editor/네마프 대지2_대지 1_20210812155822vgu.jpg" data-filename="1298" style="font-family: " noto="" sans="" kr",="" sans-serif;="" width:="" 50%;"=""><br></p><p style="text-align: left;"><br></p><p style="text-align: center; color: rgb(0, 0, 0);"><b>[서울국제대안영상페스티벌 온라인 상영관 오픈 일정]</b></p><p style="text-align: center; color: rgb(0, 0, 0);"><b><br></b></p><p style="text-align: center; color: rgb(0, 0, 0);">제21회 서울국제대안영상페스티벌의 온라인 상영관은 </p><p style="text-align: center; color: rgb(0, 0, 0);"><b>8월 19일 오전 11시부터 8월 27일 24시(자정)</b>까지 운영됩니다.</p><p style="text-align: center; color: rgb(0, 0, 0);">온라인 상영작은 총 31편이며 관람료는 영화별로 다릅니다.&nbsp; &nbsp;&nbsp;</p><p style="text-align: center; color: rgb(0, 0, 0);"><br></p><p style="text-align: center; color: rgb(0, 0, 0);">◆ <b>결제 가능 시간</b> : </p><p style="text-align: center; color: rgb(0, 0, 0);">8월 19일 11:00 ~ 8월 27일 23:59:59</p><p style="text-align: center; color: rgb(0, 0, 0);"><br></p><p style="text-align: center; color: rgb(0, 0, 0);"><span style="color: rgb(0, 0, 0);">◆</span><span style="color: rgb(0, 0, 0);">&nbsp;</span><b>관람 가능 시간</b>&nbsp;: </p><p style="text-align: center; color: rgb(0, 0, 0);">관람 가능 시간은 결제 후 24시간 이내입니다.</p><p style="text-align: center; color: rgb(0, 0, 0);">이는 관람의 시작이 아닌 종료 시점입니다.</p><p style="text-align: center;"><br></p><p style="text-align: center;">8월 27일 24:00(자정) 이후에는 모든 상영이 종료되므로 </p><p style="text-align: center;">러닝 타임을 고려하여 관람하시기 바랍니다.</p><p style="text-align: center; color: rgb(0, 0, 0);"><br></p><p style="text-align: center; color: rgb(0, 0, 0);">◆ <b>환불 규정 :</b></p><p style="text-align: center; color: rgb(0, 0, 0);">결제 후에는 관람 유무와 상관 없이 취소 및 환불이 되지 않습니다.</p><p style="text-align: center; color: rgb(0, 0, 0);"><br></p><p style="text-align: center; color: rgb(0, 0, 0);"><br></p><p style="text-align: center; "> </p>', 134, '2021-08-12 16:00:13', '2021-08-23 14:23:09'),
	(105, '0', 100, NULL, 0, 1, '[LETTER-④] OPEN & 네마프 상영작 공개', '<p style="text-align: center; "> <img src="/upload/image/common_board/editor/뉴스레터 이미지화 _2_대지 1_대지 1_20210813115242vEd.png" style="width: 25%;" data-filename="1542"></p>', 132, '2021-08-13 10:32:50', '2021-08-23 14:19:28'),
	(106, '0', 0, 888, 0, 1, '사이트 오픈 축하드립니다', '^^', 0, '2021-08-16 09:08:25', '2021-08-16 09:08:25'),
	(107, '0', 0, 886, 0, 1, 'test 문의', '<p>안녕하세요.</p><p>테스트로 문의 넣어봅니다.</p><p>관리자분 확인 해주세요</p>', 2, '2021-08-16 09:10:52', '2021-08-19 11:28:18'),
	(109, '0', 0, 900, 0, 1, '테스트', '테스트', 2, '2021-08-16 14:25:49', '2021-08-19 11:19:58'),
	(111, '0', 0, 936, 0, 1, '컴퓨터 관련 문의 드립니다', '<p>이번서 서울국제여성영화제 온라인 상영을 보려고 하는데 맥북에서 크롬을 이용해서 보려고 하는데 괜찮은가요?</p><p>메인 화면에 ios는 관람하기 힘들다는 안내를 봐서요.</p>', 2, '2021-08-17 17:14:02', '2021-08-18 20:24:26'),
	(112, '0', 0, 930, 0, 1, '문의드립니다. ', '<p>이번에 여성영화제에서 상영하는 대안현실에 주문 걸기 라는 영화를 예매했는데</p><p>마지막에 결제오류창이 떠서 다시 예매했는데 마지막에 또 오류창이 떠서요.</p><p>결제가 안 된걸로 알고 있었는데 </p><p>메일을 확인해보니 두번 결제가 되어있어서 문의드립니다.</p><p>예매가 된 게 맞나요~?</p><p>맞다면 중복된 결제 하나는 취소 부탁드립니다.&nbsp;</p>', 0, '2021-08-18 17:27:37', '2021-08-18 17:27:37'),
	(113, '0', 0, 898, 0, 1, 'Jinsoon', 'Test\n            ', 1, '2021-08-19 20:43:00', '2021-08-19 20:43:50'),
	(115, '0', 0, 898, 0, 1, 'Jinsoon2', '<p><img src="/upload/image/common_board/editor/Screenshot_20210818-094314_ONFIFn_20210819204418H2V.jpg" style="width: 322px;" data-filename="2158">\n            </p>', 4, '2021-08-19 20:44:22', '2021-08-22 15:08:05'),
	(116, '0', 0, 990, 0, 1, '애플사의 모든 기기에서 영상을 볼수없는건가요?', '\r\n            ', 0, '2021-08-19 21:33:20', '2021-08-19 21:33:20'),
	(117, '0', 0, 997, 0, 1, '해외 관람 문의', '<p>안녕하세요,</p><p><br></p><p>오는 서울국제여성영화제를 온라인으로 관람하고 싶은데 해외 거주자도 결제하면 볼 수 있나요?</p><p>그리고 iOS(아이폰)에서만 관람이 불가하지, MacOS(맥북 등 애플체제 컴퓨터)에서는 관람이 가능하지요?</p><p><br></p><p>감사합니다.&nbsp;</p>', 2, '2021-08-20 04:16:09', '2021-08-20 04:18:03'),
	(118, '0', 100, NULL, 0, 1, '[공지사항] 모바일 SNS 로그인 및 SNS 회원가입 관련', '<div style="text-align: center; "><b>[공지사항] </b></div><div style="text-align: center; "><b>모바일 SNS 로그인 및 SNS 회원가입 오류</b></div><div style="text-align: center;"><br></div><div style="text-align: center;">안녕하세요.&nbsp;</div><div style="text-align: center;">온피프엔입니다.</div><div style="text-align: center;"><br></div><div style="text-align: center;">금일 모바일 SNS 로그인 및 SNS 회원가입시 </div><div style="text-align: center;">오류가 발생하고 있습니다.</div><div style="text-align: center;">현재 빠르게 조치하고 있습니다.</div><div style="text-align: center;"><br></div><div style="text-align: center;"><b>&lt;온피프엔 간편 회원가입&gt; 및 </b></div><div style="text-align: center;"><b>아이디와 패스워드를 통한 로그인을 부탁드립니다.</b></div><div style="text-align: center;"><br></div><div style="text-align: center;">불편을 끼쳐 드려 정말 죄송합니다.</div><div style="text-align: center;"><br></div><div style="text-align: center;">조치 후 재공지 드리겠습니다.</div><div style="text-align: center;"><br></div><div style="text-align: center; ">감사합니다.</div> ', 27, '2021-08-20 10:35:48', '2021-08-23 10:18:05'),
	(119, '0', 100, NULL, 0, 1, '[공지사항] <온피프엔> 안드로이드 모바일 앱(APP) 관련', '<div style="text-align: center; "><b>[공지사항] </b></div><div style="text-align: center; "><b>&lt;온피프엔&gt; 안드로이드 모바일 앱(APP) 일시적 오류&nbsp;</b></div><div style="text-align: center;"><br></div><div style="text-align: center;">안녕하세요</div><div style="text-align: center;">온피프엔입니다.</div><div style="text-align: center;"><br></div><div style="text-align: center;">현재 안드로이드 모바일 앱(APP)이 원활하게 작동하지 않고 있습니다.</div><div style="text-align: center;"><br></div><div style="text-align: center;">빠르게 조치 중에 있사오니,<br></div><div style="text-align: center;"><b>가급적 PC에서 관람을 부탁드리겠습니다</b>.</div><div style="text-align: center;"><br></div><div style="text-align: center;">불편을 끼쳐드려 대단히 죄송합니다.</div><div style="text-align: center; "><br></div><div style="text-align: center; ">감사합니다.</div> ', 32, '2021-08-20 17:53:42', '2021-08-23 14:17:25'),
	(120, '0', 0, 898, 0, 1, 'jinsoo3', '<p>322342342342<img src="/upload/image/common_board/editor/04_구글플레이_202108210018138dX.jpg" style="width: 50%;" data-filename="2161"></p>', 0, '2021-08-21 00:18:21', '2021-08-22 15:08:25'),
	(126, '0', 100, NULL, 0, 1, '[공지사항] 서울국제여성영화제 온라인 상영관 오픈 일정', '<p class="0" style="text-align: center; background: rgb(255, 255, 255);"><img src="/upload/image/common_board/editor/배너(web)_20210823102537vKa.jpg" style="width: 50%;" data-filename="2169"></p><p class="0" style="text-align: center; background: rgb(255, 255, 255);"><br></p><p class="0" style="text-align: center; background: rgb(255, 255, 255);"><br></p><p class="0" style="text-align: center; background: rgb(255, 255, 255);"><b>[서울국제여성영화제 온라인 상영관 오픈 일정]</b></p><p class="0" style="text-align: center; background: rgb(255, 255, 255);"><b><br></b></p><p class="0" style="text-align: center; background: rgb(255, 255, 255);">제23회 서울국제여성영화제의 온라인 상영관은 </p><p class="0" style="text-align: center; background: rgb(255, 255, 255);"><b>8월 27일 오전 11시부터 9월 1일 12시(정오)까지 운영</b>됩니다. </p><p class="0" style="text-align: center; background: rgb(255, 255, 255);">온라인 상영작은 총<b> 66편</b>이며 <b>관람료는 영화별로 다릅니다.&nbsp;</b> &nbsp;</p><p class="0" style="text-align: center; background: rgb(255, 255, 255);"><br></p><p class="0" style="text-align: center; background: rgb(255, 255, 255);">◆&nbsp;<b>결제 가능 시간</b></p><p class="0" style="text-align: center; background: rgb(255, 255, 255);">8월 27일 11:00 ~ 8월 31일 23:59:59</p><p class="0" style="text-align: center; background: rgb(255, 255, 255);"><br></p><p class="0" style="text-align: center; background: rgb(255, 255, 255);">◆&nbsp;<b>결제 유효 시간</b>&nbsp;</p><p class="0" style="text-align: center; background: rgb(255, 255, 255);">결제 후 12시간 내에 관람을 끝마치셔야 합니다. </p><p class="0" style="text-align: center; background: rgb(255, 255, 255);">관람의 시작이 아닌 관람 종료 시점입니다. </p><p class="0" style="text-align: center; background: rgb(255, 255, 255);">러닝 타임을 고려하여 결제하시기 바랍니다.</p><p class="0" style="text-align: center; background: rgb(255, 255, 255);">결제 후에는 취소 및 환불이 되지 않습니다.</p><p class="0" style="text-align: center; background: rgb(255, 255, 255);"><br></p><p class="0" style="text-align: center; background: rgb(255, 255, 255);">◆&nbsp;<b>관람 가능 시간</b> </p><p class="0" style="text-align: center; background: rgb(255, 255, 255);">8월 27일 11:00 ～ 9월 1일 12:00(정오)</p><p class="0" style="text-align: center; background: rgb(255, 255, 255);"><br></p><p style="text-align: center;">◆&nbsp;<b>환불 규정&nbsp;</b></p><p style="text-align: center;">결제 후에는 관람 유무와 상관 없이 취소 및 환불이 되지 않습니다.</p> ', 9, '2021-08-23 10:27:11', '2021-08-23 14:22:53'),
